import React from 'react'
import { Button } from '@mui/material'
import AddIcon from '@mui/icons-material/Add';
import './css/sidebar.css'
import Sidebaroptions from './Sidebaroptions';
import InboxIcon from '@mui/icons-material/Inbox';
import StarRateOutlinedIcon from '@mui/icons-material/StarRateOutlined';
import AccessTimeOutlinedIcon from '@mui/icons-material/AccessTimeOutlined';
import SendIcon from '@mui/icons-material/Send';
import DescriptionIcon from '@mui/icons-material/Description';
import ReportGmailerrorredIcon from '@mui/icons-material/ReportGmailerrorred';
import LabelOutlinedIcon from '@mui/icons-material/LabelOutlined';
import ChatOutlinedIcon from '@mui/icons-material/ChatOutlined';
import ScheduleSendOutlinedIcon from '@mui/icons-material/ScheduleSendOutlined';
import DeleteOutlinedIcon from '@mui/icons-material/DeleteOutlined';
import LabelImportantOutlinedIcon from '@mui/icons-material/LabelImportantOutlined';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import AddOutlinedIcon from '@mui/icons-material/AddOutlined';
import ExpandMoreOutlinedIcon from '@mui/icons-material/ExpandMoreOutlined';

function Sidebar() {
  return (
    <div className='sidebar'>
        <Button startIcon={<AddIcon/>} className="compose__btn">Compose</Button>

        <Sidebaroptions Icon={InboxIcon} title= {"Inbox"} number= "24" isactive={true}/>

        <Sidebaroptions Icon={StarRateOutlinedIcon} title="Starred" number="500"/>

        <Sidebaroptions Icon={AccessTimeOutlinedIcon} title="Snoozed" number="1"/>

        <Sidebaroptions Icon={SendIcon} title="Sent" number="3"/>

        <Sidebaroptions Icon={DescriptionIcon} title="Drafts" number=""/>

        <Sidebaroptions Icon={ReportGmailerrorredIcon} title="Spam" number="24"/>

        <Sidebaroptions Icon={LabelImportantOutlinedIcon} title="Important" number="24"/>

        <Sidebaroptions Icon={ChatOutlinedIcon} title="Chats" number="24"/>

        <Sidebaroptions Icon={ScheduleSendOutlinedIcon} title="Scheduled" number="24"/>

        <Sidebaroptions Icon={DeleteOutlinedIcon} title="Trash" number="24"/>

        <Sidebaroptions Icon={LabelOutlinedIcon} title="Categories" number="24"/>

        <Sidebaroptions Icon={SettingsOutlinedIcon} title="Manage labels" number="24"/>

        <Sidebaroptions Icon={AddOutlinedIcon} title="Create new label" number="24"/>

        <Sidebaroptions Icon={ExpandMoreOutlinedIcon} title= "More"/>

    </div>
  )
}

export default Sidebar
